DROP PROCEDURE IF EXISTS `proc_AvisoRecepcionRevisarTerminar`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_AvisoRecepcionRevisarTerminar` (IN `i_Id_RecepcionMaterial` INT, IN `i_valCantidad_llegada` DOUBLE, IN `i_conducto` VARCHAR(255), IN `i_observaciones` TEXT, IN `i_certificadoCalidad` VARCHAR(15))  BEGIN

	UPDATE recepcion_material SET Cantidad_Llegada = i_valCantidad_llegada, Conducto = i_conducto, 	Observaciones = i_observaciones, Certificado_Calidad = i_certificadoCalidad, Id_Estatus =  42, Terminado = 'NO'  WHERE Id_Recepcion_Material = i_Id_RecepcionMaterial;
	
	SET @val_factrua:= (SELECT Factura FROM recepcion_material WHERE Id_Recepcion_Material = i_Id_RecepcionMaterial);
	
	SET @val_numOrdenes:= (SELECT COUNT(*) FROM recepcion_material WHERE factura = @val_factrua);
	
	SET @val_numOrdenesRevisadas:= (SELECT COUNT(Id_Estatus) FROM recepcion_material WHERE factura = @val_factrua and Id_Estatus = 42);
	
	IF @val_numOrdenes = @val_numOrdenesRevisadas THEN
		UPDATE recepcion_material SET Terminado = 'SI' WHERE Factura = @val_factrua;
		SELECT 'SI';
	ELSE
		SELECT 'NO';
	end if;

END$$

DROP PROCEDURE IF EXISTS `proc_ElminarOrdencompraFactura`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_ElminarOrdencompraFactura` (IN `val_id_ordencompra` INT)  BEGIN

SET @val_factura:= (SELECT Factura FROM material_ruta WHERE Id_Material_ruta = val_id_ordencompra); 

SET @val_n_facturas:= (SELECT count(*) FROM material_ruta WHERE Factura = @val_factura);

IF @val_n_facturas = 1 THEN
   SELECT 'ultimo';   
end if;

END$$

DROP PROCEDURE IF EXISTS `proc_EnviarAvisoLaboratorio`$$
