DROP PROCEDURE IF EXISTS `proc_EnviarMaterialRecepcion`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_EnviarMaterialRecepcion` (IN `val_factura` VARCHAR(255))  BEGIN

SET @val_folio:= (SELECT Consecutivo FROM consecutivo WHERE Nombre_Tabla = 'Folio_Material_Ruta');

select Id_Material_ruta,  curdate(), Factura, Orden_Compra, Cantidad_Ruta, null, Id_Producto, null, null, null, 41, null from material_ruta WHERE Factura = val_factura;

UPDATE recepcion_material SET Folio_Material_Ruta = @val_folio WHERE Factura = val_factura; 

UPDATE consecutivo SET Consecutivo  = @val_folio +1 WHERE Nombre_Tabla = 'Folio_Material_Ruta';

UPDATE material_ruta SET Id_Estatus = 39, Fecha_Entrada = curdate() WHERE Factura = val_factura;

END$$

DROP PROCEDURE IF EXISTS `proc_LiberarMaterialLaboratorio`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_LiberarMaterialLaboratorio` (IN `f_Id_ProductoLabLiberar` INT, IN `f_Id_LabMaterialLiberar` INT, `f_Cant_FinalLabLiberar` DOUBLE, `f_Foto` VARCHAR(255))  BEGIN

	UPDATE producto SET Canridad_Inventario = f_Cant_FinalLabLiberar, Imagen = f_Foto WHERE Id_Producto = f_Id_ProductoLabLiberar;
	
	UPDATE laboratorio_material SET Id_Estatus = 43, Fecha_Liberacion = curdate() WHERE Id_Laboratorio_material = f_Id_LabMaterialLiberar;
	
	UPDATE material_ruta SET Id_Estatus = 47 WHERE Id_Material_ruta = f_Id_LabMaterialLiberar;
	
	SELECT Factura FROM laboratorio_material WHERE Id_Laboratorio_material = f_Id_LabMaterialLiberar;

END$$

